import React from "react";
import Foto from "./VereinsfotoSmall.jpg"
import Image from "../../../UI/Image/Image";

export default function() {
    return (
        <article id="vereinsfoto">
            <h3>Vereinsfoto</h3>
            <h4>Aufgenommen anlässlich der 50 jährigen Fahnenweihe im Jahr 2017</h4>
            <Image></Image>
            <img src={Foto} alt="Vereinsfoto von 2017" />
            <p class="img_description">
            Veröffentlichung mit freundlicher Genehmigung der Firma Foto Winkler
            </p>
        </article>
    )
}
